  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Lacreek National
  Wildlife Refuge outlines Refuge accomplishments from May through August of 1959.
  The report begins by summarizing the weather conditions, water conditions, habitat
  conditions, and food and cover during this period. Wildlife- including migratory
  birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
  fish, and reptiles- is also covered. The Refuge development and maintenance section
  discusses physical developments, plantings, and wildfires. Resource management is
  outlined; topics include grazing, haying, and fur harvest. A progress report on
  field investigations and applied research is also provided. The public relations
  section of the report describes recreational uses, Refuge visitors, Refuge participation.
  Items of interest, N-R forms, and newspaper articles are attached.\",\n\t\"owner_org\":
